export const UnitStyle = ({ data, sty, style, ...props }) => {
  return (
    <div
      style={{
        background: "#F3F4F4",
        borderRadius: "10px",
        display: "flex",
        alignItems: "center",
        padding: "15px",
        boxSizing: "border-box",
        flexDirection: "column",
        margin: 0,
        ...style,
        ...sty,
      }}
      {...props}
    >
      <div
        style={{
          fontFamily: "Inter, sans-serif",
          textAlign: "center",
          marginBottom: "15px",
        }}
      >
        <h4 style={{ margin: 0, fontSize: "1.1em" }}>
          <a
            style={{ textDecoration: "none", color: "inherit" }}
            href="https://minisplitmaster.us/product/all-easy-pro-wall-mounted-split-msehu-h12b-2a/"
          >
            All Easy Pro Wall – Mounted Split – MSEHU-H12B-2A / MO1ES-H12B-2A
          </a>
        </h4>
      </div>
      <div className="product-details-main" style={{ display: "flex" }}>
        <div
          style={{
            flexShrink: 0,
            textAlign: "center",
            marginLeft: "10px",
          }}
        >
          <img
            style={{
              height: "200px",
              width: "auto",
              display: "block",
            }}
            src="https://minisplitmaster.us/wp-content/uploads/2025/06/Midea-All-Easy-Pro-e1756498692370.png"
            alt="All Easy Pro Wall – Mounted Split"
          />
          <div style={{ margin: "10px" }}>
            <h5
              style={{
                display: "inline-block",
                margin: 0,
                fontFamily: "Inter, sans-serif",
              }}
            >
              PRICE: <span className="price-new"> $1,707.38 </span>
            </h5>
          </div>
        </div>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            justifyContent: "center",
            alignItems: "center",
            marginLeft: "20px",
          }}
        >
          <div
            className="rating-wrap"
            style={{
              paddingTop: "10px",
              fontFamily: "Inter, sans-serif",
              textAlign: "center",
            }}
          >
            <div
              className="contener"
              style={{
                textAlign: "center",
                marginBottom: "10px",
              }}
            >
              <span
                className="product-tag rounded"
                style={{
                  fontFamily: "Inter, sans-serif",
                  background: "#6dc5d8",
                }}
              >
                BEST
              </span>
            </div>
            Cooling BTU's: 12,000
            <br />
            Heating BTU's: 12,000
            <br />
            SEER: 25.5
            <br />
            Power: 208-230V/60
          </div>
          <div
            className="only-circle"
            style={{
              textAlign: "center",
              marginTop: "20px",
            }}
          >
            <button
              className="all-easy-pro-wall-mounted-split-msehu-h12b-2a-mo1es-h12b-2a"
              style={{
                backgroundColor: "#6cbdb6",
                padding: "8px 30px",
              }}
              type="button"
            >
              See more
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};
